mapper.select:
	SELECT
	    count(*)
	FROM
	    clifl  as_clifl_1
	where 1=1
	
		and upper(as_clifl_1.cli_lname) like #{cliLname,jdbcType=VARCHAR}
    
     
		and as_clifl_1.cli_code=#{cliCode,jdbcType=VARCHAR}
    
    
		and as_clifl_1.cli_cty=#{cliCty,jdbcType=VARCHAR}
    
    
		and as_clifl_1.cli_st=#{cliSt,jdbcType=VARCHAR}
    
    
		and as_clifl_1.cli_type=#{cliType,jdbcType=VARCHAR}

SELECT
	as_clifl.cli_code AS as_clifl_cli_code,
	as_clifl.cli_lname AS as_clifl_cli_lname,
	as_clifl.cli_mainagt AS as_clifl_cli_mainagt,
	as_clifl.cli_addr1 AS as_clifl_cli_addr1,
	as_clifl.cli_addr2 AS as_clifl_cli_addr2,
	as_clifl.cli_addr3 AS as_clifl_cli_addr3,
	as_clifl.cli_addr4 AS as_clifl_cli_addr4,
	as_clifl.cli_cty AS as_clifl_cli_cty,
	as_clifl.cli_srctype AS as_clifl_cli_srctype,
	as_clifl.cli_telidd AS as_clifl_cli_telidd,
	as_clifl.cli_tel AS as_clifl_cli_tel,
	as_clifl.cli_faxidd AS as_clifl_cli_faxidd,
	as_clifl.cli_fax AS as_clifl_cli_fax
FROM  
(  
	SELECT as_clifl_2.*, ROWNUM RN  
	FROM (
	   SELECT as_clifl_1.* FROM clifl  as_clifl_1 where 1=1
	   
			and upper(as_clifl_1.cli_lname) like #{cliLname,jdbcType=VARCHAR}
	   
	   
			and as_clifl_1.cli_code=#{cliCode,jdbcType=VARCHAR}
	   
	   
			and as_clifl_1.cli_cty=#{cliCty,jdbcType=VARCHAR}
	   
	   
			and as_clifl_1.cli_st=#{cliSt,jdbcType=VARCHAR}
	   
	   
			and as_clifl_1.cli_type=#{cliType,jdbcType=VARCHAR}
	   
	   order by as_clifl_1.cli_cdate desc
	) as_clifl_2  
	 
	WHERE ROWNUM < #{page.endIndex,jdbcType=INTEGER}
)  as_clifl
WHERE RN > #{page.startIndex,jdbcType=INTEGER}
